import React from 'react';
import { Link } from 'react-router-dom';

function Dashboard() {
  return (
    <div>
      <h2>Dashboard</h2>
      <ul>
        <li>
          <Link to="/services">View All Services</Link>
        </li>
        <li>
          <Link to="/services/add">Add a Service</Link>
        </li>
        <li>
          <Link to="/bookings">View All Bookings</Link>
        </li>
      </ul>
    </div>
  );
}

export default Dashboard;
